// src/components/StoreButton.js
import React from 'react';
import './StoreButton.css';

const StoreButton = ({ link, imgSrc, altText }) => {
    return (
        <a href={link} className="store-button">
            <img src={imgSrc} alt={altText} />
        </a>
    );
};

export default StoreButton;
